  constructor(private route: ActivatedRoute,private util: CommonUtil) { }

  ngOnInit(): void {
    this.route.queryParams.subscribe(params => {

      switch(params["type"]) {
        case "cpu":{
          this.myrows=this.cpus;
          this.categorytitle="CPUs";
          break;
        }
        case "case":{
          this.myrows=this.cases;
          this.categorytitle="Cases";
          break;
        }
        case "cpucooler":{
          this.myrows=this.cpucooler;
          this.categorytitle="Cpucoolers";
          break;
        }
        case "motherboard":{
          this.myrows=this.motherboard;
          this.categorytitle="Motherboards";
          break;
        }
        case "memory":{
          this.myrows=this.memorys;
          this.categorytitle="Ram Memory";
          break;
        }
        case "storage":{
          this.myrows=this.storages;
          this.categorytitle="Storage";
          break;
        }
        case "gpu":{
          this.myrows=this.gpu;
          this.categorytitle="Graphics Card";
          break;
        }
        case "psu":{
          this.myrows=this.psu;
          this.categorytitle="Power Supply";
          break;
        }
        case "os":{
          this.myrows=this.os;
          this.categorytitle="Operating System";
          break;
        }
        case "monitor":{
          this.myrows=this.monitors;
          this.categorytitle="Monitors";
          break;
        }
        default:{
          console.log("Category not in list");
          break;
        }
      }
    });
  }

  addToCart(components: any,$event: any) {
    this.util.cart.push(components);
  }


